"use strict";function showEntry(t){var n="";t.map(function(t){n+='\n      <div class="album">\n        <div class="image">\n          <img src='.concat(t["im:image"][2].label,' alt="">\n        </div>\n          <div class="text">\n            <h3>').concat(t["im:artist"].label," - ").concat(t.title.label,'</h3>\n            <ul>\n              <li><span class="medium-text">Category</span> ').concat(t.category.attributes.term,'</li>\n              <li><span class="medium-text">Release: </span> ').concat(t["im:releaseDate"].attributes.label," </li>\n            </ul>\n          </div>\n      </div>"),contentBox.innerHTML=n})}function getData(){fetch("https://itunes.apple.com/us/rss/topalbums/limit=100/json").then(function(t){return t.json()}).then(function(t){console.log(t.feed.entry),showEntry(t.feed.entry)}).catch(function(t){return console.log(t)})}var contentBox=document.querySelector(".content-box");getData();